@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a rdfs:Class .
atm:Account a rdfs:Class .
atm:Bank a rdfs:Class .
atm:CashCard a rdfs:Class .
atm:Customer a rdfs:Class .

atm:ownsCard a rdf:Property ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank a rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount a rdf:Property ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy a rdf:Property ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:validCard a rdf:Property ;
    rdfs:domain atm:CashCard ;
    rdfs:range rdfs:Literal .

atm:readSerialNumber a rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:CashCard .

atm:readBankCode a rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:CashCard rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:validCard ;
    owl:someValuesFrom [
        a owl:Class ;
        owl:oneOf ( "true"^^xsd:boolean )
    ]
] .

atm:ATM rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:readSerialNumber ;
    owl:someValuesFrom atm:CashCard
] .

atm:ATM rdfs:subClassOf [
    a owl:Restriction ;
    owl:onProperty atm:readBankCode ;
    owl:someValuesFrom atm:Bank
] .
